INSERT INTO `exerciciocardiovascular` (`id`,`descricao`,`nome`) VALUES 
 (1,'\"É o deslocamento do corpo utilizando as pernas, sendo este um exercício com uma intensidade mais elevada do que um caminhar normal.\"','\"Caminhada\"'),
 (2,'\"É se locomover de forma mais rápida, e geralmente a posição do corpo e a forma da marcha é um pouco diferente para executar esse movimento.\"','\"Corrida\"'),
 (3,'\"É se locomover de forma mais lento do que a corrida, e geralmente a posição do corpo e a forma da marcha é um pouco diferente para executar esse movimento.\"','\"Trote\"'),
 (4,'\"É uma atividade rítmica e cíclica, ideal para desenvolvimento dos sistemas de energia aeróbico e anaeróbico, dependendo do tipo de treinamento aplicado.\"','\"Ciclismo\"'),
 (5,'\"É uma atividade física que consiste em deslocar-se em meio líquido. Por movimentar praticamente todos os músculos e articulações do corpo, a prática da natação é considerada um dos melhores exercícios físicos existentes.\"','\"Natação\"'),
 (6,'\"Atividade que envolve a prática de uma série de movimentos que exigem força, flexibilidade e coordenação motora.\"','\"Ginásticas\"'),
 (7,'\"Sistemas de práticas e tradições para treinamento de combate.\"','\"Lutas\"');
INSERT INTO `exercicioflexibilidade` (`id`,`nome`,`tipomembro`,`descricao`) VALUES 
 (1,'\"Exercício 1\"',1,'\"Alongamento para panturilha. Apoia-se na parede, estenda a perna de trás sentindo alongar o gastrocnêmio. Após faça com a outra perna..\"'),
 (2,'\"Exercício 2\"',1,'\"Alongamento para panturrilha. Apoia-se na parede, flexione a perna de trás abaixando o quadril. Após faça com a outra perna.\"'),
 (3,'\"Exercício 3\"',1,'\"Alongamento do glúteo. Deitado, flexione a perna encostando no peito, outra perna estendida no chão. Após faça com a outra perna.\"'),
 (4,'\"Exercício 4\"',1,'\"Alongamento do quadril. Agachado, com um joelho apoiado no chão estenda o máximo o quadril, após faça com a outra perna.\"'),
 (5,'\"Exercício 5\"',1,'\"Alongamento do quadril. Agachado estenda o máximo a perna traseira. Após faça com a outra perna.\"'),
 (6,'\"Exercício 6\"',1,'\"Alongamento do quadril. Apoia-se com um dos pés em um apoio projetando o quadril para frente. Após faça com a outra perna.\"'),
 (7,'\"Exercício 7\"',1,'\"Alongamento da coxa. Agachado apoie o joelho da perna traseira no chão, com a mão oposta segure a ponta do pé e aprxime dos glúteos. Após faça com a outra perna.\"'),
 (8,'\"Exercício 8\"',1,'\"Alongamento da coxa. Deitado coloque uma toalha na ponta de um dos pés, estenda a perna para cima. Após faça com a outra perna.\"'),
 (9,'\"Exercício 9\"',1,'\"Alongamento da coxa. Estenda a perna em um apoio na altura do quadril, aproximando o tronco da perna. Após faça com a outra perna.\"'),
 (10,'\"Exercício 10\"',1,'\"Alongamento da coxa. Sentado com as pernas afastadas e estendidas, segure um dos pés aproximando o tronco na perna. Após faça com a outra perna.\"'),
 (11,'\"Exercício11\"',1,'\"Alongamento da coxa. Sentado, encoste uma palma do pé na outra, afastando os joelhos ao máximo.\"'),
 (12,'\"Exercício 12\"',1,'\"Alongamento da coxa. Sentado, afaste ao máximo as pernas, inclinando um pouco o tronco para frente.\"'),
 (13,'\"Exercício 13\"',1,'\"Alongamento das pernas. Sentado e com as pernas bem estedidas, prenda uma toalha nos pés e puxe em direção ao corpo.\"'),
 (14,'\"Exercício 14\"',1,'\"Alongamento do glúteo. Deitado em posição dorsal, flexione uma das pernas cruzando a outra que stá estendida. Após faça com a outra perna.\"'),
 (15,'\"Exercício 15\"',1,'\"Alongamento de coxa e glútro. Deitado em posição dorsal, fexione o quadril e joelho de uma das pernas. Segure a ponta do pé aproximando em direção ao peito. Após faça com a outra perna.\"'),
 (16,'\"Exercício 16\"',1,'\"Alongamento de glúeos e lombar. Deitado abrace os joelhos aproximando bem do peito.\"'),
 (17,'\"Exercício 17\"',1,'\"Alongamento da lombar. Sentado e levemente flexionado as pernas, segure a ponta dos pés aproximando o máximo o trono dos pés.\"'),
 (18,'\"Exercício 18\"',1,'\"Alongamento da coxa. Em pé apoiado na parede, deixe o quadril de descolcar lateralente para um dos lados até o máximo possível. Repita no outro lado.\"'),
 (19,'\"Exercicio 19\"',1,'\"Alongamento da coxa. Em pé escore a ponta do pé em um apoio a suas costa. Estenda o quadril para baixo. Após faça com a outra perna.\"'),
 (20,'\"Exercício 20\"',1,'\"Alongamento das coxas. Em pé e flexionando o quadril, solte o peso do corpo para baixo.\"'),
 (21,'\"Exercício 21\"',2,'\"Alongamento de braços e costas. De joelhos e as palmas das mãos no chão,  estenda os braços o mais distante possível.\"'),
 (22,'\"Exercício 22\"',2,'\"Alongamento doo braço. Em pé, segure o cotovelo aproximando-o ao ombro do lado oposto. Após, faça com o outro braço.\"'),
 (23,'\"Exercício 23\"',2,'\"Alongamento dos braços e costas. Em uma barra, se pendure e deixa o peso do corpo agir para baixo.\"'),
 (24,'\"Exercício 24\"',2,'\"Alongamento de braços e peito. Em pé apoie a palma da mão em uma abertura de porta, fazendo com que os braços estendidos vão para atrás do corpo.\"'),
 (25,'\"Exercício 25\"',2,'\"Alongamento de braço e peito. Em pé com o braço estendido e apoiado em uma superfície plana, estender o máximo atrás das costas, alinhado com o ombro. Após, faça com o outro braço.\"'),
 (26,'\"Exercício 26\"',2,'\"Alongamento de peito e ombro. Em pé, um ajudante segura as mãos realizando uma hiperextensão horizontal dos ombros, cruzando os punhos, até seu limite.\"'),
 (27,'\"Exercício 27\"',2,'\"Alongamento para as costas e braços. Em pé, apoie-se em uma barra, flexioando o quadril em direção ao solo.\"'),
 (28,'\"Exercício 28\"',2,'\"Alongamento para o braço. Em pé, segurando um dos cotovelos, estenda o máximo possível colocando o cotovelo atrás da cabeça.\"'),
 (29,'\"Exercício 29\"',2,'\"Alongamento para braços e antebaço. Em quatro apoios, ponta dos dedos invertida, faça uma extensão dos dedos com a ajuda do corpo, este se delocando para trás.\"'),
 (30,'\"Exercício 30\"',2,'\"Alongamento para ombro e pescoço. Em pé, puxe um braço por trás do corpo, inclinando a cabeça para o mesmo sentido.Após, faça com o outro braço.\"'),
 (31,'\"Exercício 31\"',2,'\"Alongamento para o pescoço. Em pé, lentamente, faça movimentos de rotação da cabeça. Estendendo o pescoço para um lado e para outro, para frente e para trás.\"');
INSERT INTO `exerciciomusculacao` (`id`,`grupomuscular`,`descricao`,`nome`) VALUES 
 (72,6,'\"Segurando manopolas em polias altas, deve-se inclinar o tronco a frente, aproximando as mãos a frente e \"\"colado\"\" do abdomem.\"','\"Cross-over\"'),
 (73,6,'\"Deitado em um banco segurando um par de halteres, deve-se estender os braços abaixo da linha do banco, vagarosamente eleva-se os braços estendidos aproximando os halteres no alto(na altura do mamilo).\"','\"Crucifixo\"'),
 (74,6,'\"Ficando pendurado nas paralelas, deve-se estender os braços por completo, deixando o corpo descer vagarosamente até a altura do peito.\"','\"Paralelas\"'),
 (75,6,'\"Com apoio nas costas de um banco, segura-se um halteres. Braço estendido acima da cabeça. Trazer o halteres com o braço estendido na altura do mamilo.\"','\"Pull-over com halteres\"'),
 (76,6,'\"Os polegares devem estar por fora, e a pega da barra depende  essencialmente do tipo de supino pretendido, fechado, normal ou largo.  Faz-se descer suavemente a barra até ao nível do peito (encostando a barra ao peito, na parte superior/clavicular). Mantendo as costas encostadas ao banco, e os pés firmemente \"\"colados\"\"   ao solo, empura-se controladamente a barra até se aproximar da extensão total dos braços, e novamente repetir o movimento de descida. Deve-se inspirar no movimento descida, e expirar no movi\"','\"Supino inclinado\"'),
 (77,6,'\"Os polegares devem estar por fora, e a pega da barra depende  essencialmente do tipo de supino pretendido, fechado, normal ou largo.  Faz-se descer suavemente a barra até ao nível do peito (encostando a barra ao peito, a meio da zona entre o pescoco e mamilo).   Mantendo as costas encostadas ao banco, e os pés firmemente \"\"colados\"\"   ao solo, empura-se controladamente a barra até se aproximar da extensão total dos braços, e novamente repetir o movimento de descida. Deve-se inspirar no movimento descida, e ex\"','\"Supino reto\"'),
 (78,6,'\"No aparelho específico, alinhe os cotovelos na altura dos ombros, aproxime-os vagarosamente, retornando da mesma forma.\"','\"Voador\"'),
 (79,5,'\"Segure uma barra com uma pegada com as palmas das mãos para frente, com as mãos um pouco mais abertas do que a largura dos ombros. Segure a barra na altura dos ombros. Lentamente levante até que os cotovelos se estendam completamente.\"','\"Desenvolvimento com barra\"'),
 (80,5,'\"Segure os halteres com uma pegada com as palmas das mãos para frente, com as mãos um pouco mais abertas do que a largura dos ombros. Segure os halteres na altura dos ombros. Lentamente levante até que os cotovelos se estendam completamente acima da cabeça.\"','\"Desenvolvimento com halteres\"'),
 (81,5,'\"Levante a barra pela frente até os braços estarem num ângulo de 90 graus em relação ao corpo ou ligeiramente mais altos. Usnado halteres, realizar o movimento dos braços alternados.\"','\"Elevações frontais dos ombros\"'),
 (82,5,'\"Levante os pesos para os lados até os braços estarem num ângulo de 90 graus em relação ao corpo ou ligeiramente mais altos.\"','\"Elevações laterais dos ombros\"'),
 (83,3,'\"Segure um haltere em cada mão com uma pegada neutra (de modos que as palmas das mãos apontem uma para a outra). Flexione os cotovelos trazendo os halteres em direção aos ombros. Para total envolvimento dos bíceps supine suas mãos enquanto os halteres são levantados, gire as mãos gradualmente de forma que as palmas estejam voltadas para trás no final do movimento.\"','\"Rosca bíceps alternada\"'),
 (84,3,'\"Segure uma barra, onde suas mãos estarão supinadas e braços levemente afastados da linha dos ombros. Flexione os cotovelos trazendo os halteres em direção aos ombros.\"','\"Rosca bíceps direta\"'),
 (85,3,'\"Num banco inclinado segure uma barra, onde suas mãos estarão supinadas e braços levemente afastados da linha dos ombros. Flexione os cotovelos trazendo os halteres em direção aos ombros.\"','\"Rosca bíceps scott\"'),
 (86,3,'\"Segure uma barra, onde suas mãos estarão pronadas e braços levemente afastados da linha dos ombros. Flexione os cotovelos trazendo os halteres em direção aos ombros.\"','\"Rosca bíceps inversa\"'),
 (87,4,'\"Pernas semiflexionadas, tronco paralelo ao chão. Braços estendidos segurando halteres. Realizar uma extensão horizontal dos braços, aastando o máximo os halteres.\"','\"Voador invertido\"'),
 (88,4,'\"Assuma uma posição sentado ou ajoelhado numa polia alta, dependendo do modelo. Segure a barra próximo às extremidades de modos que os braços formem um \"\"V\"\". Relaxe os braços numa posição totalmente estendida, com o tronco e cintura retos e em linha com os braços. Puxe para baixo numa velocidade moderada, concentrando-se em trazer os cotovelos para baixo. Ocorrerá flexão nos cotovelos mas é uma conseqüência da adução, isto é, passiva. Traga a barra até a frente do queixo(frontal) ou até que toque a parte de t\"','\"Puxada frontal/dorsal\"'),
 (89,4,'\"Segurando uma barra flexione os cotovelos trazendo-la na altura do queixo sempre próximo do corpo.\"','\"Remada elevada\"'),
 (90,4,'\"Segurando a barra e estando com o corpo inclinado á frente, aproxime ela encostando no abdomem vagarosamente. Retorne lentamente estendendo os braços.\"','\"Remada curvada com barra\"'),
 (91,4,'\"Sentado e com as pernas semiflexionadas, segure a manopla pressa na polia baixa do aparellho. Deixe os braços estendios, em seguida flexione trazendo suas mãos para junto de seu corpo na altura do abdomem.\"','\"Remada sentada no puxador\"'),
 (92,4,'\"Segurando a barra na polia alta com os braços estendidos, deve-se aproximar da linha do quadril. Retornando vagarosamente até a altura dos ombros.\"','\"Pull-down\"'),
 (93,7,'\"Pés firmemente no chão e barra apoiadas na parte posterior da cabeça e nos ombros. Empurrar até a extensão completa. No movimento descendente, parte excêntrica, parar quando o joelho estiver em um ângulo de 90 graus, não é necessário flexionar o joelho mais do que 90 graus.\"','\"Agachamento com barra\"'),
 (94,7,'\"Pés firmemente na plataforma do aparelho e empurrar até a extensão completa. No movimento descendente, parte excêntrica, parar quando o joelho estiver em um ângulo de 90 graus, não é necessário flexionar o joelho mais do que 90 graus.\"','\"Agachamento Pack\"'),
 (95,7,'\"Estenda as pernas até a total extensão, flexione até um ângulo de 90 graus.\"','\"Extensão de joelhos\"'),
 (96,7,'\"Flexione os joelhos até que estejam num ângulo de 90 graus.\"','\"Flexão de joelhos\"'),
 (97,7,'\"Pés firmemente na plataforma do aparelho inclinado e empurrar até a extensão completa. No movimento descendente, parte excêntrica, parar quando o joelho estiver em um ângulo de 90 graus, não é necessário flexionar o joelho mais do que 90 graus.\"','\"Leg-press inclinado\"'),
 (98,7,'\"O posicionamento dos calcanhares, pode ser, paralelo a coxa, desviado  para dentro ou para fora, consoante a zona do músculo (médio, interior ou exterior) que se pretende trabalhar.  A máquina deve ser previamente ajustada de modo a que o peso seja todo  ele erguido no movimento de ascensão do exercício.  Erguendo os calcanhares, deve-se cuidadosamente destravar a maquina (esta deve ser destravada e travada sempre em posição alta). Partindo da posição alta, com o suporte bem assentadonos ombros,  costas direitas, e com os joelhos bloqueados  deve-se  iniciar o movimento de descida dos calcanhares até que os músculos estejam totalmente alongado.  Sem sobressaltos, deve-se lentamente levantar os calcanhares, apoiando e empurrando a extremidade dos pés sobre o seu suporte, até a total  extensão dos joelhos.\"','\"Panturriha elevação em pé\"'),
 (99,7,'\"O posicionamento dos calcanhares, pode ser, paralelo a coxa, desviado  para dentro ou para fora, consoante a zona do músculo (médio, interior ou exterior) que se pretende trabalhar. Erguendo os calcanhares, deve-se cuidadosamente destravar a máquina (esta deve ser destravada e travada sempre em posição alta). Partindo da posição alta, com o suporte bem assentado nas pernas e costas direitas deve-se  iniciar o movimento de descida dos calcanhares até que os músculos estejam totalmente alongado.  Sem sobressaltos, deve-se lentamente levantar os calcanhares, apoiando e empurrando a extremidade dos pés sobre o seu suporte, até a total  extensão dos joelhos.\"','\"Panturrilha - levação sentado\"'),
 (100,7,'\"Em pé com pernas semiflexionadas estática, flexione o quadril levando a barra até o chão, retornado com a barra até a altura do quadril.\"','\"Terra stiff\"'),
 (101,8,'\"Sentado em um banco com coluna alinhada. Braços estendidos acima da cabeça segurando uma barra. Deve-se deixar descer a barra lentamente atrás de sua cabeça, retornando vagarosamente até a completa extensão dos braços acima da cabeça.\"','\"Tríceps com barra\"'),
 (102,8,'\"Deitando num banco de supino, com os braços flexionados encostando a barra na testa. Estender por completo o braço, retornando lentamente ao ponto de partida.\"','\"Tríceps na testa\"'),
 (103,8,'\"Em pé com o corpo levemente inclinado para frente, braço colado ao corpo e antebraço num ângulo de 90 graus, pegada em pronação. Estender o antebraço até encostar nas pernas, retornando lentamente ao ponto inicial.\"','\"Tríceps roldana\"'),
 (104,8,'\"Em pé com o corpo levemente inclinado para frente, braço unilateralmente colado ao corpo e antebraço num ângulo de 90 graus, pegada em supinação. Estender o antebraço até encostar nas pernas, retornando lentamente ao ponto inicial.\"','\"Tríces unilateral pulley\"'),
 (105,2,'\"Segurando uma barra com punhos em pronação. Os antebraços devem estar apoiados nas pernas, deixar rolar a barra flexionando o máximo os punhos, no retorno estenda todo o punho.\"','\"Rosca punho pronada\"'),
 (106,2,'\"Segurando uma barra com punhos em supinação. Os antebraços devem estar apoiados nas pernas, deixar rolar a barra estendendo o máximo os punhos, no retorno  flexione todo o punho.\"','\"Rosca punho supinada\"'),
 (107,1,'\"No aparelho devemos flexionar o abdomem se aproximando dos joelhos, realizar a força concentrada no abdomem e não nos braços.\"','\"Abdominal máquina\"'),
 (108,1,'\"Deitado sobre as costas, joelhos semiflexionados/flexionadas (com pernas levantadas ou não)  e mãos sobre a cabeça (cruzadas ou não sobre a nuca, ou sobre as temporas).   Nesta posição, deve-se encostar a coluna lombar ao solo (ou banco) e   inspirar. Expirando lentamente e potentemente, deve flexionar a coluna  lombar, conduzindo o osso do esterno, na direção do púbis (sem descolar  do solo ou banco, a parte inferior das costas) e o quadril em drieção a cabeça. Marca-se um tempo de paragem em posicao alta, encolhendo a barriga voluntariamente (trabalho  dos transversais), com o intuito de procurar uma contração máxima.  Deve-se então de seguida retomar o regresso ao solo ou banco, inspirando e controlando totalmente o movimento.\"','\"Crunches\"'),
 (109,1,'\"Apoiado em paralelas ou em aparelho semelhante, deve-se flexionar o quadril trazendo os joelhos na altura do umbigo, excêntricamente deve-se estender até 45 graus do quadril.\"','\"Abdominal nas paralelas\"'),
 (110,1,'\"Completamente deitado sobre as costas, com pernas estendidas E joelhos  ligeiramente fletidos, o executante inspira, para depois, expirando, levar as pernas à posição vertical, sempre com a preocupação de não desencostar,  a coluna lombar do solo (ou banco). Na continuidade do movimento, faz-se  descer as pernas (no sentido oposto). Logo que a coluna lombar descole  do suporte (solo ou banco), deve-se elevar as pernas, sem interrupção e brusquidão no movimento, e sobretudo sem balanço, recorrendo única e   exclusivamente ao grupo de músculos abdominais. De seguida, executa-se o processo de regresso ao solo (ou banco), inspirando, controlando e conduzindo todo o movimento.\"','\"Elevação das pernas na prancha\"'),
 (111,1,'\"Com uma barra apoiada aos ombros atrás da cabeça, deve realizer rotações laterais lentamente, concentrando a força na região abdominal.\"','\"Rotação do tronco\"');
